import React, { Component } from 'react';
import {View, Text, StyleSheet ,Image} from 'react-native';
export default class ViewPoint extends Component {
  render() {
    return (
      <View style={styles.container}>
        <View style={styles.leftContainer}>
          <Image width="250" height="100px" source={require('../../assets/img/logo.svg')} />
          <Text>ELECTION OK21</Text>
        </View>
        <View style={styles.rightContainer}>
          <Text>lorem10</Text>
        </View>
      </View>
    )
  }
}

const styles = StyleSheet.create({
  container: {
    width: '1200px',
    display: 'flex',
    flexDirection: 'row',
    minHeight: 350,
    alignItems: 'center'
  },
  leftContainer: {
    width: '35%',
    padding: '60px',
    backgroundColor: 'rgba(255,255,255,0.75)'
  },
  rightContainer: {
    flex: 1,
    width: '65%',
    backgroundColor: 'rgba(0,117,163,0.75)',
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  }
})
